import{_ as a,c as n,o as s,a as t}from"./app.7004e06b.js";const h='{"title":"SpringCloud\u5206\u5E03\u5F0F\u4E8B\u52A1Seata","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u524D\u8A00","slug":"\u524D\u8A00"},{"level":2,"title":"\u672F\u8BED\u89E3\u6790","slug":"\u672F\u8BED\u89E3\u6790"},{"level":2,"title":"\u6280\u672F\u9009\u578B","slug":"\u6280\u672F\u9009\u578B"},{"level":2,"title":"\u90E8\u7F72Seata Server","slug":"\u90E8\u7F72seata-server"},{"level":3,"title":"\u521D\u59CB\u5316\u6570\u636E\u5E93","slug":"\u521D\u59CB\u5316\u6570\u636E\u5E93"},{"level":3,"title":"\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6","slug":"\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6"},{"level":3,"title":"\u4F7F\u7528docker-compose\u542F\u52A8","slug":"\u4F7F\u7528docker-compose\u542F\u52A8"},{"level":2,"title":"\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210Seata Client","slug":"\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210seata-client"},{"level":3,"title":"\u521D\u59CB\u5316\u6570\u636E\u5E93","slug":"\u521D\u59CB\u5316\u6570\u636E\u5E93-1"},{"level":3,"title":"\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6","slug":"\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6-1"},{"level":3,"title":"\u5F15\u5165\u542F\u52A8\u7C7B\u4F9D\u8D56","slug":"\u5F15\u5165\u542F\u52A8\u7C7B\u4F9D\u8D56"},{"level":2,"title":"\u4E8B\u52A1\u5206\u7EC4","slug":"\u4E8B\u52A1\u5206\u7EC4"},{"level":3,"title":"Seata Server\u914D\u7F6E","slug":"seata-server\u914D\u7F6E"},{"level":3,"title":"Seata Client\u914D\u7F6E","slug":"seata-client\u914D\u7F6E"},{"level":3,"title":"\u5E94\u7528\u573A\u666F","slug":"\u5E94\u7528\u573A\u666F"},{"level":2,"title":"\u603B\u7ED3","slug":"\u603B\u7ED3"}],"relativePath":"java/SpringCloud\u5206\u5E03\u5F0F\u4E8B\u52A1Seata.md"}',e={},p=t(`<h1 id="springcloud\u5206\u5E03\u5F0F\u4E8B\u52A1seata" tabindex="-1">SpringCloud\u5206\u5E03\u5F0F\u4E8B\u52A1Seata <a class="header-anchor" href="#springcloud\u5206\u5E03\u5F0F\u4E8B\u52A1seata" aria-hidden="true">#</a></h1><h2 id="\u524D\u8A00" tabindex="-1">\u524D\u8A00 <a class="header-anchor" href="#\u524D\u8A00" aria-hidden="true">#</a></h2><p>\u9605\u8BFB\u672C\u7BC7\u6587\u7AE0\u60A8\u5C06\u4E86\u89E3\u5230\u5982\u4E0B\u5185\u5BB9:</p><ul><li>Seata</li><li>Seata Server \u90E8\u7F72</li><li>Seata \u4E8B\u52A1\u5206\u7EC4</li></ul><p>\u5982\u679C\u60A8\u4E86\u89E3\u4EE5\u4E0B\u5185\u5BB9, \u53EF\u4FBF\u4E8E\u7406\u89E3:</p><ul><li><a href="https://spring.io/projects/spring-cloud-alibaba" target="_blank" rel="noopener noreferrer">Spring Cloud Alibaba</a></li><li><a href="https://nacos.io/zh-cn/" target="_blank" rel="noopener noreferrer">Nacos</a></li><li><a href="https://docs.docker.com/compose/" target="_blank" rel="noopener noreferrer">Docker Compose</a></li></ul><p>\u672C\u6587\u4E3A\u5E94\u7528\u578B\u6587\u7AE0, \u5C06\u4E0D\u4F1A\u9610\u8FF0\u8FC7\u591A\u7406\u8BBA\u77E5\u8BC6</p><h2 id="\u672F\u8BED\u89E3\u6790" tabindex="-1">\u672F\u8BED\u89E3\u6790 <a class="header-anchor" href="#\u672F\u8BED\u89E3\u6790" aria-hidden="true">#</a></h2><p>\u672C\u6B21\u90E8\u7F72\u4E2D\u4F1A\u7528\u5230\u4EE5\u4E0B\u672F\u8BED:</p><ul><li>Seata Server: Seata\u670D\u52A1\u7AEF, \u5B98\u65B9\u79F0\u4E4B\u4E3A\u4E8B\u52A1\u534F\u8C03\u8005TC(<strong>T</strong>ransaction <strong>C</strong>oordinator), \u5355\u72EC\u90E8\u7F72</li><li>Seata Client: Seata\u5BA2\u6237\u7AEF, \u5B98\u65B9\u79F0\u4E4B\u4E3A\u8D44\u6E90\u7BA1\u7406\u5668RM(<strong>R</strong>esource <strong>M</strong>anager), \u4E0E\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210</li></ul><p>\u5B98\u65B9\u672F\u8BED\u8868: <a href="https://seata.io/zh-cn/docs/overview/terminology.html" target="_blank" rel="noopener noreferrer">Seata\u672F\u8BED</a></p><h2 id="\u6280\u672F\u9009\u578B" tabindex="-1">\u6280\u672F\u9009\u578B <a class="header-anchor" href="#\u6280\u672F\u9009\u578B" aria-hidden="true">#</a></h2><p>Seata\u6709\u591A\u79CD\u90E8\u7F72\u65B9\u6848, \u751F\u4EA7\u73AF\u5883\u63A8\u8350\u4F7F\u7528\u5982\u4E0B\u65B9\u5F0F: \u6CE8\u518C\u4E2D\u5FC3+\u914D\u7F6E\u4E2D\u5FC3+\u6570\u636E\u5E93</p><p>\u5BF9\u5E94\u7684\u6280\u672F\u6808\u5982\u4E0B:</p><ul><li>\u6CE8\u518C\u4E2D\u5FC3: Nacos</li><li>\u914D\u7F6E\u4E2D\u5FC3: Nacos</li><li>\u6570\u636E\u5E93: MySQL 8.0</li></ul><h2 id="\u90E8\u7F72seata-server" tabindex="-1">\u90E8\u7F72Seata Server <a class="header-anchor" href="#\u90E8\u7F72seata-server" aria-hidden="true">#</a></h2><h3 id="\u521D\u59CB\u5316\u6570\u636E\u5E93" tabindex="-1">\u521D\u59CB\u5316\u6570\u636E\u5E93 <a class="header-anchor" href="#\u521D\u59CB\u5316\u6570\u636E\u5E93" aria-hidden="true">#</a></h3><p>\u521B\u5EFA\u6570\u636E\u5E93seata-server\u53CA\u5BF9\u5E94\u7684\u8BBF\u95EE\u7528\u6237seata</p><p>\u4F7F\u7528\u5B98\u65B9\u7684\u6570\u636E\u5E93\u811A\u672C\u8FDB\u884C\u521D\u59CB\u5316: <a href="https://github.com/seata/seata/tree/develop/script/server/db" target="_blank" rel="noopener noreferrer">seata/script/server/db at develop</a></p><p>\u9664MySQL\u4EE5\u5916\u8FD8\u652F\u6301Oracle\u548CPostgreSQL</p><h3 id="\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6" tabindex="-1">\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6 <a class="header-anchor" href="#\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6" aria-hidden="true">#</a></h3><p>\u53C2\u7167\u5B98\u65B9\u90E8\u7F72\u6587\u6863: <a href="https://seata.io/zh-cn/docs/ops/deploy-by-docker-compose.html" target="_blank" rel="noopener noreferrer">\u4F7F\u7528 Docker compose \u5FEB\u901F\u90E8\u7F72 Seata Server</a></p><p>\u7F16\u5199\u670D\u52A1\u7AEF\u914D\u7F6E\u6587\u4EF6<code>registry.conf</code>:</p><div class="language-"><pre><code>registry {
  type = &quot;nacos&quot;

  nacos {
  	# \u670D\u52A1\u540D\u79F0
    application = &quot;seata-server&quot;
    serverAddr = &quot;127.0.0.1:8848&quot;
    # \u547D\u540D\u7A7A\u95F4ID
    namespace = &quot;spring-cloud-development&quot;
    group = &quot;SEATA_GROUP&quot;
    # \u96C6\u7FA4\u540D\u79F0
    cluster = &quot;default&quot;
  }
}

config {
  type = &quot;nacos&quot;

  nacos {
    serverAddr = &quot;127.0.0.1:8848&quot;
    namespace = &quot;spring-cloud-development&quot;
    group = &quot;SEATA_GROUP&quot;
    # \u914D\u7F6E\u6587\u4EF6dataId
    dataId: &quot;seata-server.properties&quot;
  }
}
</code></pre></div><p>\u5728nacos\u4E2D\u589E\u52A0\u914D\u7F6E<code>seata-server.properties</code>, \u8C03\u6574\u4E3A\u6570\u636E\u5E93\u6A21\u5F0F:</p><div class="language-properties"><pre><code><span class="token attr-name">store.mode</span><span class="token punctuation">=</span><span class="token attr-value">db</span>
<span class="token attr-name">store.db.datasource</span><span class="token punctuation">=</span><span class="token attr-value">druid</span>
<span class="token attr-name">store.db.dbType</span><span class="token punctuation">=</span><span class="token attr-value">mysql</span>
<span class="token attr-name">store.db.driverClassName</span><span class="token punctuation">=</span><span class="token attr-value">com.mysql.cj.jdbc.Driver</span>
<span class="token attr-name">store.db.url</span><span class="token punctuation">=</span><span class="token attr-value">jdbc:mysql://127.0.0.1:3306/seata-server?useUnicode=true&amp;characterEncoding=utf8&amp;connectTimeout=1000&amp;socketTimeout=3000&amp;autoReconnect=true&amp;useSSL=false</span>
<span class="token attr-name">store.db.user</span><span class="token punctuation">=</span><span class="token attr-value">seata</span>
<span class="token attr-name">store.db.password</span><span class="token punctuation">=</span><span class="token attr-value">seata</span>
</code></pre></div><p><strong>\u6CE8\u610F: \u914D\u7F6E\u7684dataId\u548Cgroup\u5E94\u4E0E<code>registry.conf</code>\u4E2D\u7684\u4E00\u81F4</strong></p><h3 id="\u4F7F\u7528docker-compose\u542F\u52A8" tabindex="-1">\u4F7F\u7528docker-compose\u542F\u52A8 <a class="header-anchor" href="#\u4F7F\u7528docker-compose\u542F\u52A8" aria-hidden="true">#</a></h3><p>\u5BF9docker-compose\u4E0D\u518D\u8D58\u8FF0, \u53EF\u9605\u8BFB\u524D\u8A00\u4E2D\u7684\u5B98\u65B9\u6587\u6863</p><p>\u7F16\u5199<code>docker-compose.yaml</code>:</p><div class="language-yaml"><pre><code><span class="token comment"># \u6839\u636E\u81EA\u5DF1\u7684docker\u7248\u672C\u9009\u62E9\u5BF9\u5E94\u7684version</span>
<span class="token key atrule">version</span><span class="token punctuation">:</span> <span class="token string">&quot;3.1&quot;</span>
<span class="token key atrule">services</span><span class="token punctuation">:</span>
  <span class="token key atrule">seata-server</span><span class="token punctuation">:</span>
    <span class="token key atrule">image</span><span class="token punctuation">:</span> seataio/seata<span class="token punctuation">-</span>server<span class="token punctuation">:</span>1.4.2
    <span class="token key atrule">hostname</span><span class="token punctuation">:</span> seata<span class="token punctuation">-</span>server
    <span class="token key atrule">ports</span><span class="token punctuation">:</span>
      <span class="token punctuation">-</span> <span class="token string">&quot;8091:8091&quot;</span>
    <span class="token key atrule">environment</span><span class="token punctuation">:</span>
      <span class="token punctuation">-</span> SEATA_PORT=8091
      <span class="token punctuation">-</span> SEATA_IP=127.0.0.1
      <span class="token comment"># \u6B64\u5904\u6709\u5751</span>
      <span class="token punctuation">-</span> SEATA_CONFIG_NAME=file<span class="token punctuation">:</span>/root/seata<span class="token punctuation">-</span>config/registry
    <span class="token key atrule">volumes</span><span class="token punctuation">:</span>
      <span class="token comment"># \u6B64\u5904\u6709\u5751</span>
      <span class="token punctuation">-</span> <span class="token string">&quot;./seata-server/config:/root/seata-config&quot;</span>
</code></pre></div><p>\u8FD9\u91CC\u6709\u4E24\u4E2A\u56E0\u4E3A\u7B14\u8005\u4E0D\u719F\u6089docker\u4EA7\u751F\u7684\u5751:</p><p>\u73AF\u5883\u53D8\u91CF<code>SEATA_CONFIG_NAME</code>, \u6307\u7684\u662F<strong>\u5BB9\u5668\u5185\u90E8\u7684\u73AF\u5883</strong></p><p>\u6240\u4EE5\u8DEF\u5F84<code>file:/root/seata-config/registry</code>\u662F\u6307, <strong>\u670D\u52A1\u7AEF\u8BFB\u53D6\u7684\u914D\u7F6E\u6587\u4EF6<code>registry.conf</code>\u4E3A\u5BB9\u5668\u5185\u90E8\u7684<code>/root/seata-config/registry.conf</code></strong></p><p>\u5E76\u975E\u6211\u4EEC\u672C\u673A\u7684<code>/root/seata-config/registry</code></p><p>\u6240\u4EE5\u6211\u4EEC\u8981\u5C06\u81EA\u5DF1\u5199\u7684\u914D\u7F6E\u6587\u4EF6\u6620\u5C04\u5230\u5176\u5185\u90E8\u4E2D, \u5373\u540E\u9762\u4E00\u4E2A\u5751: <code>&quot;./seata-server/config:/root/seata-config&quot;</code></p><p>\u5B83\u7684\u542B\u4E49\u662F<strong>\u5C06\u672C\u673A\u8DEF\u5F84<code>./seata-server/config</code>\u6620\u5C04\u5230\u5BB9\u5668\u5185\u90E8\u8DEF\u5F84<code>/root/seata-config</code></strong></p><p>\u7EFC\u4E0A, \u6211\u4EEC\u9700\u8981\u5B8C\u6210\u7684\u64CD\u4F5C\u662F:</p><ol><li>\u5728<code>docker-compose.yaml</code>\u76EE\u5F55\u4E0B\u521B\u5EFA<code>seata-server/config</code>\u76EE\u5F55</li><li>\u5C06<code>registry.conf</code>\u6587\u4EF6\u653E\u7F6E\u5230<code>\${docker-compose.yaml\u76EE\u5F55}/seata-server/config</code></li><li>\u8FD0\u884C\u547D\u4EE4<code>docker-compose up -d</code></li></ol><p>\u5982\u679C\u60A8\u9047\u5230\u4E86<code>io.seata.common.exception.NotSupportYetException: config type can not be null</code>, \u8BF7\u4ED4\u7EC6\u9605\u8BFB\u4E0A\u8FF0\u5185\u5BB9</p><h2 id="\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210seata-client" tabindex="-1">\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210Seata Client <a class="header-anchor" href="#\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210seata-client" aria-hidden="true">#</a></h2><h3 id="\u521D\u59CB\u5316\u6570\u636E\u5E93-1" tabindex="-1">\u521D\u59CB\u5316\u6570\u636E\u5E93 <a class="header-anchor" href="#\u521D\u59CB\u5316\u6570\u636E\u5E93-1" aria-hidden="true">#</a></h3><p>\u5728\u4E1A\u52A1\u7CFB\u7EDF\u4E2D\u589E\u52A0<code>undo_log</code>\u8868:</p><div class="language-mysql"><pre><code>-- \u6CE8\u610F\u6B64\u59040.3.0+ \u589E\u52A0\u552F\u4E00\u7D22\u5F15 ux_undo_log
CREATE TABLE \`undo_log\` (
  \`id\` bigint(20) NOT NULL AUTO_INCREMENT,
  \`branch_id\` bigint(20) NOT NULL,
  \`xid\` varchar(100) NOT NULL,
  \`context\` varchar(128) NOT NULL,
  \`rollback_info\` longblob NOT NULL,
  \`log_status\` int(11) NOT NULL,
  \`log_created\` datetime NOT NULL,
  \`log_modified\` datetime NOT NULL,
  \`ext\` varchar(100) DEFAULT NULL,
  PRIMARY KEY (\`id\`),
  UNIQUE KEY \`ux_undo_log\` (\`xid\`,\`branch_id\`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;
</code></pre></div><h3 id="\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6-1" tabindex="-1">\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6 <a class="header-anchor" href="#\u81EA\u5B9A\u4E49\u914D\u7F6E\u6587\u4EF6-1" aria-hidden="true">#</a></h3><p>\u5728nacos\u4E2D\u589E\u52A0\u5BA2\u6237\u7AEF\u516C\u5171\u914D\u7F6E\u6587\u4EF6<code>seata-client.properties</code>:</p><div class="language-properties"><pre><code><span class="token attr-name">seata.registry.type</span><span class="token punctuation">=</span><span class="token attr-value">nacos</span>
<span class="token attr-name">seata.registry.nacos.server-addr</span><span class="token punctuation">=</span><span class="token attr-value">127.0.0.1:8848</span>
<span class="token attr-name">seata.registry.nacos.namespace</span><span class="token punctuation">=</span><span class="token attr-value">spring-cloud-development</span>
<span class="token attr-name">seata.registry.nacos.group</span><span class="token punctuation">=</span><span class="token attr-value">SEATA_GROUP</span>
<span class="token attr-name">seata.registry.nacos.application</span><span class="token punctuation">=</span><span class="token attr-value">seata-server</span>

<span class="token attr-name">seata.config.type</span><span class="token punctuation">=</span><span class="token attr-value">nacos</span>
<span class="token attr-name">seata.config.nacos.server-addr</span><span class="token punctuation">=</span><span class="token attr-value">127.0.0.1:8848</span>
<span class="token attr-name">seata.config.nacos.namespace</span><span class="token punctuation">=</span><span class="token attr-value">spring-cloud-development</span>
<span class="token attr-name">seata.config.nacos.group</span><span class="token punctuation">=</span><span class="token attr-value">SEATA_GROUP</span>
</code></pre></div><p><strong>\u6CE8\u610F: \u5BA2\u6237\u7AEF\u914D\u7F6E\u7684group\u5E94\u4E0E\u670D\u52A1\u7AEF\u914D\u7F6E\u76F8\u540C</strong></p><h3 id="\u5F15\u5165\u542F\u52A8\u7C7B\u4F9D\u8D56" tabindex="-1">\u5F15\u5165\u542F\u52A8\u7C7B\u4F9D\u8D56 <a class="header-anchor" href="#\u5F15\u5165\u542F\u52A8\u7C7B\u4F9D\u8D56" aria-hidden="true">#</a></h3><p>\u6309\u7167<a href="https://seata.io/zh-cn/docs/ops/deploy-guide-beginner.html" target="_blank" rel="noopener noreferrer">Seata\u90E8\u7F72\u6307\u5357</a>\u63A8\u8350\u7684\u65B9\u5F0F\u5728<code>pom.xml</code>\u4E2D\u5F15\u5165\u4F9D\u8D56<code>spring-cloud-starter-alibaba-seata</code>:</p><div class="language-xml"><pre><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dependency</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>groupId</span><span class="token punctuation">&gt;</span></span>io.seata<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>groupId</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>artifactId</span><span class="token punctuation">&gt;</span></span>seata-spring-boot-starter<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>artifactId</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>version</span><span class="token punctuation">&gt;</span></span>\u6700\u65B0\u7248<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>version</span><span class="token punctuation">&gt;</span></span>
<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dependency</span><span class="token punctuation">&gt;</span></span>
<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dependency</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>groupId</span><span class="token punctuation">&gt;</span></span>com.alibaba.cloud<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>groupId</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>artifactId</span><span class="token punctuation">&gt;</span></span>spring-cloud-starter-alibaba-seata<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>artifactId</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>version</span><span class="token punctuation">&gt;</span></span>2.2.1.RELEASE<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>version</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>exclusions</span><span class="token punctuation">&gt;</span></span>
        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>exclusion</span><span class="token punctuation">&gt;</span></span>
            <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>groupId</span><span class="token punctuation">&gt;</span></span>io.seata<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>groupId</span><span class="token punctuation">&gt;</span></span>
            <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>artifactId</span><span class="token punctuation">&gt;</span></span>seata-spring-boot-starter<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>artifactId</span><span class="token punctuation">&gt;</span></span>
        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>exclusion</span><span class="token punctuation">&gt;</span></span>
    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>exclusions</span><span class="token punctuation">&gt;</span></span>
<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dependency</span><span class="token punctuation">&gt;</span></span>
</code></pre></div><p>\u4E4B\u540E\u518D\u5F15\u5165\u4E0A\u4E00\u8282\u4E2D\u7684\u5BA2\u6237\u7AEF\u914D\u7F6E\u5373\u53EF:</p><div class="language-yaml"><pre><code><span class="token key atrule">spring</span><span class="token punctuation">:</span>
  <span class="token key atrule">cloud</span><span class="token punctuation">:</span>
    <span class="token key atrule">nacos</span><span class="token punctuation">:</span>
      <span class="token key atrule">config</span><span class="token punctuation">:</span>
        <span class="token key atrule">shared-configs</span><span class="token punctuation">:</span>
          <span class="token punctuation">-</span> <span class="token key atrule">data-id</span><span class="token punctuation">:</span> seata<span class="token punctuation">-</span>client.properties
            <span class="token key atrule">group</span><span class="token punctuation">:</span> SEATA_GROUP
</code></pre></div><h2 id="\u4E8B\u52A1\u5206\u7EC4" tabindex="-1">\u4E8B\u52A1\u5206\u7EC4 <a class="header-anchor" href="#\u4E8B\u52A1\u5206\u7EC4" aria-hidden="true">#</a></h2><p>\u60F3\u8981\u5B66\u4F1A\u4E00\u4E2A\u6982\u5FF5, \u6700\u91CD\u8981\u7684\u662F\u4E86\u89E3\u4E3A\u4EC0\u4E48\u8981\u4F7F\u7528\u5B83</p><p>\u56DE\u987E\u6700\u5F00\u59CB\u7684\u6982\u5FF5, Seata Server\u662F\u4E8B\u52A1\u534F\u8C03\u8005TC(<strong>T</strong>ransaction <strong>C</strong>oordinator)</p><p>\u4E5F\u5C31\u662F\u8BF4\u5B83\u5728\u5206\u5E03\u5F0F\u4E8B\u52A1\u4E2D\u8D77\u5230\u81F3\u5173\u91CD\u8981\u7684\u4F5C\u7528</p><p>\u4F46\u5982\u4F55\u5B83\u6302\u4E86\u5462?\u6216\u8005\u7F51\u7EDC\u6CE2\u52A8\u4E86\u5462?</p><p>\u6240\u4EE5\u4E8B\u52A1\u5206\u7EC4\u5176\u5B9E\u53EF\u4EE5\u7406\u89E3\u4E3ASeata Server\u96C6\u7FA4\u5206\u7EC4, \u662F\u4E3A\u4E86TC\u7684\u9AD8\u53EF\u7528</p><h3 id="seata-server\u914D\u7F6E" tabindex="-1">Seata Server\u914D\u7F6E <a class="header-anchor" href="#seata-server\u914D\u7F6E" aria-hidden="true">#</a></h3><p>\u670D\u52A1\u7AEF\u8981\u660E\u786E\u81EA\u5DF1\u7684\u5206\u7EC4\u540D\u79F0, \u4FEE\u6539<code>registry.conf</code>\u6587\u4EF6:</p><div class="language-"><pre><code>registry {

  nacos {
  	# Seata Server\u6240\u5C5E\u96C6\u7FA4\u540D\u79F0\u4E3Adev
    cluster = &quot;dev&quot;
  }
}
</code></pre></div><p>\u6309\u7167\u5B98\u65B9\u6587\u6863<a href="https://seata.io/zh-cn/docs/user/txgroup/transaction-group.html" target="_blank" rel="noopener noreferrer">Seata \u4E8B\u52A1\u5206\u7EC4</a>, \u6B64\u5904\u6709\u4E00\u4E2A\u5751</p><p><strong>\u9700\u8981\u5728nacos\u4E2D\u589E\u52A0\u4E00\u4E2A\u4E8B\u52A1\u7EC4\u540D\u5BF9\u5E94\u96C6\u7FA4\u540D\u7684\u914D\u7F6E</strong></p><p>\u4EE5\u4E0A\u9762\u7684\u96C6\u7FA4\u4E3A\u4F8B, \u9700\u8981\u589E\u52A0<code>service.vgroup-mapping.\${\u5206\u7EC4\u540D}</code>\u914D\u7F6E, \u5185\u5BB9\u4E3A\u96C6\u7FA4\u540D\u79F0: <code>dev</code></p><p>\u539F\u56E0\u5728\u4E8E<code>RegistryService</code>\u4E2D\u5982\u4E0B\u4EE3\u7801:</p><div class="language-java"><pre><code><span class="token keyword">public</span> <span class="token keyword">interface</span> <span class="token class-name">RegistryService</span><span class="token generics"><span class="token punctuation">&lt;</span><span class="token class-name">T</span><span class="token punctuation">&gt;</span></span> <span class="token punctuation">{</span>

    <span class="token class-name">String</span> PREFIX_SERVICE_MAPPING <span class="token operator">=</span> <span class="token string">&quot;vgroupMapping.&quot;</span><span class="token punctuation">;</span>

    <span class="token class-name">String</span> PREFIX_SERVICE_ROOT <span class="token operator">=</span> <span class="token string">&quot;service&quot;</span><span class="token punctuation">;</span>

    <span class="token class-name">String</span> CONFIG_SPLIT_CHAR <span class="token operator">=</span> <span class="token string">&quot;.&quot;</span><span class="token punctuation">;</span>

    <span class="token keyword">default</span> <span class="token class-name">String</span> <span class="token function">getServiceGroup</span><span class="token punctuation">(</span><span class="token class-name">String</span> key<span class="token punctuation">)</span> <span class="token punctuation">{</span>
        <span class="token comment">// \u5047\u8BBE\u5206\u7EC4\u540D\u4E3Agroup-dev</span>
        <span class="token comment">// \u4F1A\u5728nacos\u4E2D\u5BFB\u627EdataId\u4E3Aservice.vgroupMapping.group-dev\u7684\u914D\u7F6E</span>
        key <span class="token operator">=</span> PREFIX_SERVICE_ROOT <span class="token operator">+</span> CONFIG_SPLIT_CHAR <span class="token operator">+</span> PREFIX_SERVICE_MAPPING <span class="token operator">+</span> key<span class="token punctuation">;</span>
        <span class="token keyword">if</span> <span class="token punctuation">(</span><span class="token operator">!</span>SERVICE_GROUP_NAME<span class="token punctuation">.</span><span class="token function">contains</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
            <span class="token class-name">ConfigurationCache</span><span class="token punctuation">.</span><span class="token function">addConfigListener</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span><span class="token punctuation">;</span>
            SERVICE_GROUP_NAME<span class="token punctuation">.</span><span class="token function">add</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token punctuation">}</span>
        <span class="token keyword">return</span> <span class="token class-name">ConfigurationFactory</span><span class="token punctuation">.</span><span class="token function">getInstance</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">getConfig</span><span class="token punctuation">(</span>key<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>\u5982\u679C\u5BA2\u6237\u7AEF\u542F\u52A8\u540E\u9047\u5230<code>can not get cluster name in registry config &#39;service.vgroupMapping.xx&#39;, please make sure registry config correct</code></p><p>\u8BF7\u4ED4\u7EC6\u9605\u8BFB\u4E0A\u8FF0\u5185\u5BB9</p><h3 id="seata-client\u914D\u7F6E" tabindex="-1">Seata Client\u914D\u7F6E <a class="header-anchor" href="#seata-client\u914D\u7F6E" aria-hidden="true">#</a></h3><p>\u5728\u9879\u76EE\u914D\u7F6E\u4E2D\u589E\u52A0\u5982\u4E0B\u5185\u5BB9\u5373\u53EF:</p><div class="language-yaml"><pre><code><span class="token key atrule">seata</span><span class="token punctuation">:</span>
  <span class="token key atrule">tx-service-group</span><span class="token punctuation">:</span> group<span class="token punctuation">-</span>dev
</code></pre></div><p>\u6700\u7EC8\u6548\u679C\u4E3A: \u4E8B\u52A1\u7EC4<code>group-dev</code>\u4F1A\u4F7F\u7528\u96C6\u7FA4\u540D\u79F0\u4E3A<code>dev</code>\u7684TC</p><h3 id="\u5E94\u7528\u573A\u666F" tabindex="-1">\u5E94\u7528\u573A\u666F <a class="header-anchor" href="#\u5E94\u7528\u573A\u666F" aria-hidden="true">#</a></h3><p>\u5B98\u65B9\u63D0\u4F9B\u4E86\u5F88\u597D\u7684\u793A\u4F8B, \u53EF\u53C2\u7167: <a href="https://seata.io/zh-cn/docs/user/txgroup/transaction-group-and-ha.html" target="_blank" rel="noopener noreferrer">\u4E8B\u52A1\u5206\u7EC4\u4E0E\u9AD8\u53EF\u7528 (seata.io)</a></p><h2 id="\u603B\u7ED3" tabindex="-1">\u603B\u7ED3 <a class="header-anchor" href="#\u603B\u7ED3" aria-hidden="true">#</a></h2><p>\u7EB8\u4E0A\u5F97\u6765\u7EC8\u89C9\u6D45</p><p>\u7406\u89E3Seata\u548C\u5B9E\u9645\u90E8\u7F72Seata\u4E4B\u95F4, \u8FD8\u9694\u7740docker/nacos\u7B49\u6280\u672F\u9E3F\u6C9F</p><p>\u6700\u540E\u603B\u7ED3\u4E0B\u4F7F\u7528Seata\u7684\u6574\u4F53\u6D41\u7A0B:</p><ol><li>\u90E8\u7F72Seata Server</li><li>\u4E3A\u4E8B\u52A1\u8FDB\u884C\u5206\u7EC4</li><li>\u4E1A\u52A1\u7CFB\u7EDF\u96C6\u6210Seata Client</li></ol><p><strong>\u6211\u662FHoutaroy, \u82E5\u6709\u4E00\u884C\u4EE3\u7801\u80FD\u4E3A\u4ED6\u4EBA\u63D0\u4F9B\u5E2E\u52A9, \u4FBF\u662F\u5728\u4E0B\u7684\u6BD5\u751F\u8363\u5E78</strong></p>`,81),o=[p];function c(l,r,i,u,d,k){return s(),n("div",null,o)}var v=a(e,[["render",c]]);export{h as __pageData,v as default};
